import React, { useState } from 'react';
import Say from './Say';
import EventPractice from './EventPractice';
import './Iframe.css';

const Iframe = ({ src }) => {
    
  const [currentPage, setCurrentPage] = useState('say');

  const renderPage = () => {
    switch (currentPage) {
      case 'say':
        return <Say />;
      case 'eventPractice':
        return <EventPractice />;
      default:
        return <Say />;
    }
  };

  return (
    <div className="iframe-container">
      <div className="toggle-buttons">
        <button onClick={() => setCurrentPage('say')}>Say</button>
        <button onClick={() => setCurrentPage('eventPractice')}>Event Practice</button>
      </div>
      <iframe title="content-frame" className="content-frame">
        {renderPage()}
      </iframe>
    </div>
  );

};

export default Iframe;
